import * as React from "react";
import styled from "styled-components";

const homePage = ()  => {
    return (
      <Wrap>
        <Title>Adarsh mithila party</Title>
      </Wrap>
    );
  };
const Wrap = styled.main`
  display: flex;
  justify-content: center;
  background: tan;
`;
const Title =styled.section`
  font-size: 64px;
  font-family: fantasy;
  margin-top: 16px;
  color: darkgreen;
  `;

export default homePage;
